import { Text, View } from 'react-native';
import { home } from '../style/style.js';

export default function LogEvent() {
  return (
    <View style={style.container}>
      <View style={style.header}>
        <Text style={style.title}>Your Current Data</Text>
      </View>
    </View>
    );
}
